import React from 'react';
import { GoogleLogout } from 'react-google-login';


const clientId = "660110466067-69udlgbrcl25a39sc1uhujv79kco4hak.apps.googleusercontent.com"

function Logout() {
    const onSuccess = () => {
        console.log(`[Logged out of Google successfully!]`);
    };

    return (
        <div>
            <GoogleLogout
            clientId = {clientId}
            buttonText="Logout"
            onLogoutSuccess={onSuccess}
            ></GoogleLogout>       
        </div>
    );
}
export default Logout;
